var tipuesearch = {"pages": [{'title': 'About', 'text': "\n 四設計一甲 40823102 劉怡萱 \n 倉儲: 40823102 cad2020 \n Youtube: Aasta's channel \n \n", 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'Topics', 'text': '', 'tags': '', 'url': 'Topics.html'}, {'title': 'W1', 'text': '', 'tags': '', 'url': 'W1.html'}, {'title': 'Solidworks', 'text': '\n \n', 'tags': '', 'url': 'Solidworks.html'}, {'title': 'Inventor', 'text': '\n 繪圖影片 \n \n', 'tags': '', 'url': 'Inventor.html'}, {'title': 'W2', 'text': '第二周進度: \n 錄製\xa0 Solidworks零件繪圖練習1 inventor繪圖流程1-50題 \n 錄製\xa0 Solidworks零件繪圖練習2 inventor繪圖流程1-2大題 \n 影片連結: Solidworks零件繪圖練習1 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0  Solidworks零件繪圖練習2 \n Solidworks零件繪圖練習2  inventor繪圖零件檔\xa0 \xa01-2大題 \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '中秋節快樂! \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '1.開始實施每周自評、互評\xa0 電腦輔助設計實習自評與互評表單 \n', 'tags': '', 'url': 'W4.html'}, {'title': 'Wink3', 'text': '2.下載並 利用 \xa0Wink3 \xa0 建立電腦操作流程導引影片 \n \n \n \n \n \n', 'tags': '', 'url': 'Wink3.html'}, {'title': 'W5', 'text': '錄製\xa0 Solidworks零件繪圖練習2 inventor繪圖流程3-1到3-17大題 \n 影片連結: \xa0 Solidworks零件繪圖練習2 \n Solidworks零件繪圖練習2\xa0 inventor繪圖零件檔\xa0 \xa0\xa0 3-1到3-17 大題 \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '錄製\xa0 Solidworks零件繪圖練習2 inventor繪圖流程3-18到4-2大題 \n 影片連結: \xa0 Solidworks零件繪圖練習2 \n Solidworks零件繪圖練習2\xa0 零件繪圖練習2 inventor繪圖流程3-18到4-2大題 \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '', 'tags': '', 'url': 'W7.html'}, {'title': '工程師特質', 'text': '工程師兩大特質 1.creat具有創造性 practitioners需擁有條件invent design analyze build 且經過 trial and error 工程職業人員\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0發明\xa0 \xa0 \xa0設計\xa0 \xa0 分析\xa0 \xa0 \xa0構建\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0反覆測試 2.聰明精巧且正確的配置 數學英文很重要 (用於工程師之間溝通) mathematics數學分析能力 scientific principles 科學原理分析能力 \n', 'tags': '', 'url': '工程師特質.html'}, {'title': 'SciTE 編輯器', 'text': '利用 SciTE 編輯器類解譯 ANSI C 程式 \n 下載\xa0 tcc gnoplot , 解開壓縮檔案至資料夾後的目錄為 tcc, 其中包含 tcc.exe, 可以用來編譯 ANSI C 程式 \n 修改start.abt路徑 \n \n \n 將前面解壓縮後下載的資料夾裡的 wscite資料夾將cpp.properties複製 \n \n \n 放置datapad_based/data/wscite415/wscite裡覆蓋原有的 cpp.properties檔 \n \n \n', 'tags': '', 'url': 'SciTE 編輯器.html'}, {'title': 'W8', 'text': '完成全部Solidworks零件繪圖練習2 使用inventor繪圖流程影片及零件檔 \n 影片連結: \xa0 Youtube-Solidworks零件繪圖練習2 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 Solidworks零件繪圖練習2繪圖過程影片 \n 零件檔:\xa0 Inventor繪製Solidworks零件繪圖練習2零件檔 \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W17', 'text': '', 'tags': '', 'url': 'W17.html'}, {'title': 'Lesson point', 'text': '多人網際協同-專業定位，無遠弗屆(國際化) \n 持續改進-分散版本與歷程(近端及遠端) \n 虛實互動-價值導向解決問題(定性及定量(數學模擬)) \n 機電資軟硬整合-買方導向，高度客製化(適者生存) \n', 'tags': '', 'url': 'Lesson point.html'}, {'title': '小組', 'text': '', 'tags': '', 'url': '小組.html'}, {'title': 'W10 meeting', 'text': '使用google meeting組員一同討論主題方向，並規畫進行草圖設計 \n \n', 'tags': '', 'url': 'W10 meeting.html'}, {'title': 'W11meeting', 'text': '第11週小組討論meeting錄影 \n \n \n', 'tags': '', 'url': 'W11meeting.html'}, {'title': 'W12meeting', 'text': '第12週小組討論meeting錄影 \n 確認主題為設計軌道並 透過圓形轉盤讓 使滾珠能在上面重複滾動 \n', 'tags': '', 'url': 'W12meeting.html'}, {'title': 'W13meeting', 'text': '第13周小組討論meeting錄影 \n 完成草圖並繪製大概3D圖形 \n \n 組員繪製的草圖 \n \n \n', 'tags': '', 'url': 'W13meeting.html'}, {'title': 'W14meeting', 'text': '第14周小組討論meeting錄影 \n', 'tags': '', 'url': 'W14meeting.html'}, {'title': 'W15meeting', 'text': '第15周小組討論meeting錄影 \n', 'tags': '', 'url': 'W15meeting.html'}, {'title': 'W16meeting', 'text': '第16周小組討論meeting錄影 \n', 'tags': '', 'url': 'W16meeting.html'}, {'title': 'CoppeliaSim Edu', 'text': '', 'tags': '', 'url': 'CoppeliaSim Edu.html'}, {'title': '顏色調整', 'text': '打開零件檔 \n \n 須注意檔案為stl檔且名稱為英文 \n \n 選取檔案後須將 Drop colors 打勾 \n \n', 'tags': '', 'url': '顏色調整.html'}]};